import React, {Fragment} from 'react'
import Shay from './img/shay.png'


const Tete_affiche = () => {
    const [data, setData] = useState([]);

    useEffect(() => {

        const fetchData = async () => {
        const result = await axios(
        "/memory_admin/controller/information_faq/information_faq_api.php",
        );

        setData(result.data);
        console.log("updated");
        };
        fetchData();
        console.log("mounted");
    }, [])
    // const handleClick = (key,e) => {  
    //   e.preventDefault();    
    //   console.log(key);  
    // }

    return (
        <Fragment> 
            <Navigation />
            {data./*filter(name => name.id === 286).*/map((item, key) => (

            <div class="artiste_tete_affiche" key={key}>
                <img class="image_tete_affiche" src={Shay} alt="" />
                <div class="div_opacity_dans_texte"></div>
                <div class="text_sous_artiste_tete_affiche">SHAY <br /> 07 Juin 2021</div>
            </div>
            ))}

            <div className="informations_pratiques__faq_all">
                <h1>INFORMATIONS PRATIQUES & FAQ</h1>
                {/* <ul className="image_reseau_sociaux_flex">
                    <div className="flex_reseau_sociaux"> */}
                    {data./*filter(name => name.id === 286).*/map((item, key) => (
                        // <a onClick={(e) => handleClick(key,e)} key={key} >
                            <li className={"article"} key={key}>
                            {/* <Link to="chart" to={item.url_reseau_sociaux}> */}
                            {/* <button className="btn_reseau_sociaux" onClick={()=> window.location= item.url_reseau_sociaux }>
                                <img className="image_reseau_sociaux" src={`data:image/png;base64, ${item.image_reseau_sociaux}`} alt="" />
                            </button>  */}
                            <ul>
                                <li>
                                    {/* <button > */}
                                        <div className="titre_information_faq">
                                            { item.titre_information_faq} 
                                            <i class='fas fa-angle-down' style={{ marginLeft:"10px", fontSize:"24px"}}></i>
                                        </div>
                                    {/* </button> */}
                                </li>
                                <div className="sous_titre_et_contenu_information_faq">
                                    <li>
                                        <div className="sous_titre_information_faq">{ item.sous_titre_information_faq}</div>
                                    </li>
                                    
                                    <li>
                                        <div>{ item.contenu_information_faq}</div>
                                    </li>
                                </div>
                            </ul>
                            {/* </Link> */}
                            </li>
                        // </a>
                        ))}
                    {/* </div>
                </ul> */}
            </div>
            <Footer />
        </Fragment>        
    )   
}

export default Tete_affiche
